      <h2>Help with CSV and Excel
        <a style="font-size:80%" href="/web/20130716152006/https://archive.org/about/javascript-required.htm" onclick="return IASearch.toggle('csvhelp')">(show/hide help)</a>
      </h2>
      <b>Instructions for using the advanced search engine to create reports for
        items pertaining to books...</b>
      <div style="display:none;" id="csvhelp">

        <p>
          If a contributing library wished to see how many pages were digitized in the month of August 2008, here is how this would be done.
        </p>

        go to archive.org<br/>
        click on Go!<br/>
        click on "advanced search"<br/>
        look half way down the page to the "advanced XML Search" window.<br/>
        Type into the "Query" field-
        "contributor:(library of congress) AND publicdate:[2008-08-01 TO 2008-08-30]"<br/>
        <h4>Important:</h4>
        <ul>
          <li>No " " required. Must have "()" around contributor name.</li>
          <li>No spaces after ":" </li>
        </ul>
        By holding down the "Shift" Key, highlight the fields you want to
        eventually have exported to excel. For example-
        "date, identifier, imagecount and title"<br/>
        Click the radio button for "CSV"<br/>
        Hit "search". There might be a small delay as the search is executed.
        In this query,  approx. 2143 results will be returned.<br/>
        When prompted, save the ".csv" file to your hard drive and note
        the location saved.<br/>
        Open Excel and open the previously saved ".csv" file.
        It will parse the data into columns and you now will be able to sort,
        sum, or otherwise manipulate the data.<br/>
      </div>



      <h2>Notes</h2>
      <ul>
        <li>You can try constructing a search query and hitting "Search" in the top "Advanced Search" section and then coming "back" to this section to copy that query into the "Query:" box.
        <li>"downloads" is the number of downloads for content in an item</li>
        <li>"month" is the number of downloads in the last 30 days </li>
        <li>"week" is the number of downloads in the last 7 days</li>
        <li>We have a <b>known bug</b> in our site <b>with using " TO " in things like titles/descriptions</b>.  If you run into a problem and need to use " TO ", use it lowercase and you will avoid this bug.</li>
      </ul>


  
  
      <h2>Dates and ranges</h2>
      The following dates can be used for range queries:
      <ul>
        <li>addeddate</li><li>createdate</li><li>date</li><li>indexdate</li><li>publicdate</li><li>reviewdate</li><li>updatedate</li>      </ul>

      The special date field, "oai_updatedate",
      can be used to mean all of the following dates combined:
      <ul>
        <li>addeddate</li><li>indexdate</li><li>publicdate</li><li>reviewdate</li><li>updatedate</li>      </ul>
      The rationale for "oai_updatedate" date merging is to allow something like
      the <a href="https://web.archive.org/web/20130716152006/http://www.openarchives.org/">Open Archives Initiative</a>
      protocol get time-sortable lists of updated or added items.
      <ul>
        <li>addededate -- should be time the item was initially added to archive</li>
        <li>indexdate -- should be last time item had a change that updated our search engine</li>
        <li>publicdate -- should be, for *most* items, the time after its first derive is done (ie: has "public formats" for a /details/ page)</li>
        <li>reviewdate -- updated to be the most recent time of all reviews (updated on new reviews and review changes)</li>
        <li>updatedate -- mostly the time of the last /editxml/ page submit for an item</li>
      </ul>
      <br/><br/>
      
      Example date ranges:
      <code>updatedate:[2007 TO 2008]</code>
      <code>createdate:[2007-02-01 TO 2007-02-11]</code>
      
      <br/><br/>
      For dates like "sponsordate" that are not able to do ranges,
      they can still use * wildcards, for example:
      <code>sponsordate:200802*</code><br/>
      
      <h2>Example queries</h2>
            <code>
        <a href="/web/20130716152006/https://archive.org/advancedsearch.php?q=publicdate:[2008-02-01 TO 2008-03-01] AND contributor:smithsonian#raw">publicdate:[2008-02-01 TO 2008-03-01] AND contributor:smithsonian</a>
      </code>
            <code>
        <a href="/web/20130716152006/https://archive.org/advancedsearch.php?q=sponsordate:200802* AND mediatype:texts#raw">sponsordate:200802* AND mediatype:texts</a>
      </code>
            <code>
